import React, { Component } from "react";

class Resume extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col-6">
            <h1>Col 1</h1>
          </div>
        </div>
        <div className="row">
          <div className="col-6">
            <h1>Col 2</h1>
          </div>
        </div>
      </div>
    );
  }
}

export default Resume;
